import Header from '../Header/Header';
import Styles from './HeroBlock.module.scss';


const HeroBlock = () => {
  return (
    <div className={Styles.Block}>
      <Header />
      <div className={Styles.Wrapper}>
          <div>
              <div className={Styles.HeroInfo}>
                  <div className={Styles.HeroInfo__title}>
                      Премиальное защищённое рабочее место
                  </div>
                  <div className={Styles.HeroInfo__subtitle}>
                      Собственная операционная система и&nbsp;производительный ноутбук. Новый уровень безопасности и&nbsp;приватности
                  </div>
                  <div className={Styles.HeroInfo__button}>
                      Оставить заявку
                  </div>
              </div>
              <div className={Styles.HeroFeature}>
                  <div className={Styles.HeroFeature__image}></div>
                  <div className={Styles.HeroFeature__features}></div>
              </div>
          </div>
          <div></div>
      </div>
    </div>
  );
};

export default HeroBlock;
